import './App.css';
import * as React from "react";
import { Routes, Route} from "react-router-dom";
import HomeScreen from "./screens/HomeScreen"

function App() {
  return (
    <div className="App">
     <Routes>
        <Route path="/" element={<HomeScreen />} />
        {/* <Route path="about" element={<About />} /> */}
      </Routes>
    </div>
  );
}

export default App;
